// src/components/Home.js
import React from 'react';
import './Home.css'; // Ensure the CSS file is linked

function Home() {
    return (
        <div className="home">
            <h1>Welcome to Our Restaurant Management System</h1>
            <p>Your one-stop solution for managing your restaurant efficiently.</p>
            <div className="features">
                <h2>Features</h2>
                <ul>
                    <li>Track Orders in Real-Time</li>
                    <li>Manage Reservations</li>
                    <li>Update and Customize Menu Items</li>
                </ul>
            </div>
            <div className="get-started">
                <h2>Get Started</h2>
                <p>To view the orders, go to the <strong>Orders</strong> page.</p>
                <p>Check out the <strong>Reservations</strong> to see upcoming bookings.</p>
                <p>Modify your offerings on the <strong>Menu Items</strong> page.</p>
            </div>
        </div>
    );
}

export default Home;
